title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o22146.m12 -> o22133.m9 -> o22146.m11 -> o22133.m8 -> o22146.m12
  o22133.m8 -> o22146.m12 -> o22133.m9 -> o22146.m11 -> o22133.m8
  o22146.m3 -> o22133.m9 -> o22146.m11 -> o22133.m8 -> o22146.m12 -> o22133.m9
  o22146.m6 -> o22133.m8 -> o22146.m12 -> o22133.m9 -> o22146.m11 -> o22133.m8
  o22146.m4 -> o22133.m9 -> o22146.m11 -> o22133.m8 -> o22146.m12 -> o22133.m9
  o22133.m9 -> o22146.m11 -> o22133.m8 -> o22146.m12 -> o22133.m9
  o22133.m10 -> o22146.m6 -> o22133.m8 -> o22146.m12 -> o22133.m9 -> o22146.m11 -> o22133.m8
  o22146.m11 -> o22133.m8 -> o22146.m12 -> o22133.m9 -> o22146.m11

features:
  - inheritance
  - overriding
  - method
  - polymorphism

